import { Link } from "react-router-dom";
export const Navigation = ({languages}) => {
    return (
        <ul>
            console.log(languages);
            {
                languages.map((x) =>
                    <li>
                        <Link to={`/${x.toLowerCase()}`}>{x}</Link>
                    </li>
                )
            }
        </ul>
    );
}

